from Crypto.Util.number import long_to_bytes

def integer_cube_root(n):
    """Calcule la racine cubique enti√®re de n"""
    low = 0
    high = n
    while low < high:
        mid = (low + high) // 2
        if mid**3 < n:
            low = mid + 1
        else:
            high = mid
    if high**3 > n:
        return high - 1
    return high

